import './App.css';
import Header from './screens/templates/header'
//import LastPropertyForSales from './screens/components/lastPropertyForSales'

import React, { useEffect, useState } from 'react';

function App() {

  const [propertyId, setPropertyId] = useState(null)
  const [propertyStatus, setPropertyStatus] = useState(null)

  useEffect(() => {
    fetch("http://localhost:8000/api/v1/properties")
    .then(results => results.json())
    /*.then(data => {
      const {property} = data.results[0]
      setPropertyId(property.propertyId)
      setPropertyStatus(property.propertyStatus)
    })*/
    .catch(error => console.log(error))
  }, [])

  return (
    <div className="App">
        <Header />
        <h1>Properties list</h1>
        {!propertyId || !propertyStatus ? 'loading...': `${propertyId} ${propertyStatus}`}
    </div>
  );

}

export default App;
